import React from "react";
import { useState } from "react";
import Switch from "@mui/material/Switch"
import FormGroup from "@mui/material/FormGroup"
import { FormControl, FormLabel, FormControlLabel } from "@mui/material";
import getMuiTheme from 'material-ui/styles/getMuiTheme';
import MuiThemeProvider from 'material-ui/styles/MuiThemeProvider';

const Activator = () => {
    const [checked, setChecked] = useState(false)

    const handleChange = (event: React.ChangeEvent<HTMLInputElement>) => {
        setChecked(event.target.checked)
    }
   
    const muiTheme = getMuiTheme({
        toggle: {
          thumbOnColor: 'yellow',
          trackOnColor: 'red'
        }
      });

    return (
        <>
            <MuiThemeProvider muiTheme={muiTheme}></MuiThemeProvider>
            <FormControl>
                <FormLabel>Press to activate the service:</FormLabel>
                <FormGroup>
                    <FormControlLabel control={<Switch checked={checked} onChange={handleChange} name="activator"/>} 
                        label="Activate"/>
                </FormGroup>
            </FormControl>
        </>
    )
}

export default Activator;
